/*! Scripts */

$(function() {

	if(window.location.hash !== '')
	{
		if($(window.location.hash).length) 
		{
			$("html, body").animate({ scrollTop: $(window.location.hash).offset().top }, 'fast');
		}
	}

	//Faq

    /*$('.faq-questions-list').on( 'click touchstart', 'dt', function(event) {

        if ($(this).is('.is-active')) {
            $(this).removeClass('is-active').next('dd').slideUp('fast');
        }
        else {
            $(this).addClass('is-active').next('dd').slideDown('fast');
        }
        event.preventDefault();
    });*/

	//About

	$('.about-caption-toggle').on( 'click touchstart', function(event) {

		var heightDefault   = 135;
			heightRealy = $(this).parent().find('.about-caption-text-in').height();

		if ($(this).is('.is-active')) {

			$(this).removeClass('is-active').parent().find('.about-caption-text').animate({'max-height': heightDefault}, 'fast');
			$(this).parent().find('.about-caption-text .trtch').css('display', 'inline-block');
		}
		else {
			$(this).addClass('is-active').parent().find('.about-caption-text').animate({'max-height': heightRealy}, 'fast');
			$(this).parent().find('.about-caption-text .trtch').css('display', 'none');
		}
		event.preventDefault();
	});

	//Reviews

	$('.reviews-text-toggle').on( 'click touchstart', function(event) {

		var heightDefault   = 85;
			heightRealy = $(this).parent().find('.reviews-text .reviews-text-in').height();

		if ($(this).is('.is-active')) {

			$(this).removeClass('is-active').parent().find('.reviews-text').animate({'max-height': heightDefault}, 'fast');

		}
		else {
			$(this).addClass('is-active').parent().find('.reviews-text').animate({'max-height': heightRealy}, 'fast');
		}
		event.preventDefault();
	});

	
	$('.reviews-reply-toggle').on( 'click touchstart', function(event) {

		var heightDefault   = 140;
			heightRealy = $(this).parent().find('.reviews-reply .reviews-reply-in').innerHeight();

		if ($(this).is('.is-active')) {

			$(this).removeClass('is-active').parent().find('.reviews-reply').removeClass('open').animate({'max-height': heightDefault}, 'fast');

		}
		else {
			$(this).addClass('is-active').parent().find('.reviews-reply').addClass('open').animate({'max-height': heightRealy}, 'fast');
		}
		event.preventDefault();
	});


	// City Dropdown

	$('.city-link').on( 'click touchstart', function(event) {
		$('.city-dropdown-overlay').addClass('is-active').animate({'opacity': 0.3}, 'fast', function(){
			$('.city-dropdown').slideDown('fast');
		});
		event.preventDefault();
	});

	$('.city-dropdown-close').on( 'click touchstart', function(event) {
		$('.city-dropdown').slideUp('fast', function(){
			$('.city-dropdown-overlay').animate({'opacity': 0}, 'fast', function(){
				$(this).removeClass('is-active');
			});
		});
		event.preventDefault();
	});


	// Tooltip Bootstrap

	$('.tooltip-link').tooltip({
		container: 'body'
	}).on('shown.bs.tooltip', function () {

	    $('.tooltip-close').on( 'click', function() {
			$('.tooltip-link').tooltip('hide');
		});

		$('body').on( 'click', function(e) {

	    	if($(e.target).closest('.tooltip, .tooltip-link').length==0) {
				$('.tooltip-link').tooltip('hide');
			}

		});

	});

	


	// Scroll Top

    $(window).on( 'scroll', function() {
                                       
		if ($(this).scrollTop() > 100) $('.btn-scroll-up').fadeIn(240);
		else $('.btn-scroll-up').fadeOut(240);

		// if ($(this).scrollTop() > $('#calc').offset().top) $('.btn-scroll-to').fadeIn(240);
		// else $('.btn-scroll-to').fadeOut(240);

	});


	$('.btn-scroll-up').on( 'click touchstart', function(event) {

		var href = $(this).attr('href');

		if ( href == '#calc' ) $('body, html').animate({ scrollTop: $('#calc').offset().top }, 'slow');
		else $('body, html').animate({ scrollTop: 0 }, 'slow');

		console.log(href)
		event.preventDefault();
	});

	$('.btn-scroll-to, .btn-scroll-calc').on( 'click touchstart', function(event) {
		var el = $(this).attr('href');
		$('html, body').animate({
            scrollTop: $(el).offset().top
        }, 'slow');

		event.preventDefault();
	});


	// Show/Hide and Swipe nav mobile

	var body = $('body'),
		navMob  = $('.nav-mob'),
		navMobClose = $('.nav-mob-close'),
		navMobOpen = $('.nav-mob-open'),
		overlay = $('.nav-mob-overlay');


		$('.nav-mob-open').on( 'click', function() {

			body.addClass('nav-open');
			overlay.addClass('is-active').animate({'opacity': 0.6}, 240);
			navMob.animate({'right': 0}, 240);
			navMobClose.addClass('is-active');

		});

		$('.nav-mob-close, .nav-mob-overlay').on( 'click', function() {

			body.removeClass('nav-open');
			overlay.removeClass('is-active').animate({'opacity': 0}, 240);
			navMob.animate({'right': -260}, 240);
			navMobClose.removeClass('is-active');

		});



	navMob.swipe( {
		swipeStatus:function(event, phase, direction, distance, duration, fingers) {

			if ( phase == 'move' && direction == 'left' && distance <= 130 && !body.hasClass('nav-open') ) {


				overlay.addClass('is-active').css({'opacity': distance * 0.6 / 130});
				navMob.css({'right': distance * 2 - 260});
				navMobClose.addClass('is-active');
				navMobOpen.addClass('is-active');
				
			}

			if ( phase == 'cancel' && direction == 'left' && distance <= 130 && !body.hasClass('nav-open') ) {

				overlay.removeClass('is-active').animate({'opacity': 0}, 'fast');
				navMob.animate({'right': -260}, 'fast');
				navMobClose.removeClass('is-active');
				navMobOpen.removeClass('is-active');

			}

			if ( phase == 'end' && direction == 'left' && !body.hasClass('nav-open') ) {

				body.addClass('nav-open');
				overlay.animate({'opacity': 0.6}, 'fast');
				navMob.animate({'right': 0}, 'fast');
				navMobOpen.removeClass('is-active');

			}

			/* --- */

			if ( phase == 'move' && direction == 'right' && distance <= 130 && body.hasClass('nav-open') ) {

				overlay.css({'opacity': 0.6 - distance * 0.6 / 130});
				navMob.css({'right': distance * -2});
				
			}

			if ( phase == 'cancel' && direction == 'right' && distance <=130 && body.hasClass('nav-open') ) {

				overlay.animate({'opacity': 0.6}, 'fast');
				navMob.animate({'right': 0}, 'fast');

			}

			if ( phase == 'end' && direction == 'right' && body.hasClass('nav-open') ) {

				body.removeClass('nav-open');
				overlay.removeClass('is-active').animate({'opacity': 0}, 'fast');
				navMob.animate({'right': -260}, 'fast');
				navMobClose.removeClass('is-active');

			}


	},
    	triggerOnTouchEnd: true,
    	threshold: 65
    });

    $('.how-work-happen-open').on( 'click touchstart', function(e) {
		if ($(this).is('.active')) {
			$(this).removeClass('active').closest('.how-work-happen').find('.how-work-happen-content').slideUp('fast');
		}
		else {
			$(this).addClass('active').closest('.how-work-happen').find('.how-work-happen-content').slideDown('fast');
		}
		e.preventDefault();
	});

	$('.how-work-happen-close').on( 'click touchstart', function(e) {
		$('.how-work-happen-open').removeClass('active');
		$('.how-work-happen-content').slideUp('fast');
		e.preventDefault();
	});





});
